import React, { Component } from 'react'
import { Line, Circle } from 'rc-progress'

class DownloadProgress extends Component {
    render (){
        return (
            <div style={{width: '50%'}}>
                <Line percent="10" strokeWidth="1" strokeColor="#D3D3D3"/>
            </div>
        )
    }
}

export default DownloadProgress
